    console.log("entered value", e.target.value);
    let finalValue = validate
      ? type === "onlyAlpha"
        ? RegExp()
        : RegExp()
      : e?.target?.value;
    setinputValue(finalValue);
  };
  return (
    <Box sx={{ p: 1 }}>
      <TextField
